import React from "react";

import classes from "./ProfileImageInfo.module.css";



const ProfileImageInfo = (props) =>{





return (

<div className={classes.profileImageInfo}>


                 <div className={classes.nameDiv}>
                                           <i className={classes.name_i}><h2>{props.data.usertitle}  {props.data.firstname}   {props.data.lastname}</h2> </i>
                 </div>
                 <div className={classes.profileImageInfo_status}>  <i>Status</i>  <i>Not Available!</i> </div>
                 <div className={classes.profileImageInfo_joiningDate}> <i>Joined </i> <i>Not Available </i> </div>
                 <div className={classes.profileImageInfo_position}> <i>Joined Since </i> <i>active</i>  </div>








</div>
);

}

export default ProfileImageInfo;
